import React from 'react'
import Form from 'bootstrap/dist/css/bootstrap.min.css';

const FederationSwitch = () => {
  return (
    <Form>
      <Form.Check
        type="switch"
        id="custom-switch"
        label="Check this switch"
      />
    </Form>
  );
}

export default FederationSwitch;
